package com.github.sofiaguyang.leetcode.isomorphic_strings

import spock.lang.Specification
import spock.lang.Unroll


class IsomorphicStringsTest extends Specification {

    @Unroll
    def "Returns #expected that #s and #t are isomorphic"() {
        given:
        def trackingMappedCharSolution = new IsomorphicStringsViaTrackingMappedChar()
        def trackingIndexArraySolution = new IsomorphicStringsViaTrackingIndexUsingArray()
        def trackingIndexMapSolution = new IsomorphicStringsViaTrackingIndexUsingMap()

        expect:
        trackingMappedCharSolution.isIsomorphic(s, t) == expected
        trackingIndexArraySolution.isIsomorphic(s, t) == expected
        trackingIndexMapSolution.isIsomorphic(s, t) == expected

        where:
        s          | t          || expected
        'egg'      | 'add'      || true
        'paper'    | 'title'    || true
        'foo'      | 'bar'      || false
        'ab'       | 'aa'       || false
        lengthyS() | lengthyT() || true
    }

